Правительство Москвы приглашает студентов на Добровольный квалификационный экзамен, чтобы оценить свой уровень знаний для старта карьеры. Пройти онлайн-тестирование могут студенты бакалавриата и магистранты из Москвы и Московской области. 

ДКЭ это: 
— 6 направлений: маркетинг, менеджмент, финансы и аналитика, IT, инженерное дело и строительство, гостиничное дело; 
— Практика и трудоустройство в компаниях-партнерах для лучших участников; 
— Электронный сертификат, подтверждающий квалификацию;
— Образовательные материалы и курсы английского по специальности от Skyeng, профориентационные уроки от SuperJob.

Участвуйте в #dkemoscow до 14 апреля включительно: https://clck.ru/FaXcq

Из РТУ МИРЭА в Германию!

Магистратура, программы сертификатов и карьера в Германии:

 • Дешевле, чем в Москве – от 5 000 €;
 • Возможность работать во время и после учебы;
 • Признаваемый в ЕС и остальном мире диплом;
 • Специальности: бизнес, маркетинг, IT, журналистика и медиа, творческие профессии (музыка, кино, дизайн, прикладное искусство).

Хочешь узнать больше? Приходи на семинар 17 апреля с экспертом из берлинского Macromedia University.

